import React, { Component } from 'react';
import { Button } from 'antd';

class Third extends Component {
    onClick = () => {
        console.log("You clicked button");
    }
    render() {
        return (
            <div>
                <Button onClick type = "dashed">Cilck here</Button>
            </div>
        );
    }
}

export default Third;
